import { BrowserRouter, Route, Routes } from "react-router-dom";
import { AppRoute } from "./routes";

import { Landing } from "../pages/Landing";

export default function AppRoutes() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path={AppRoute.Landing} element={<Landing />} />
      </Routes>
    </BrowserRouter>
  );
}
